import React from 'react';
import styled from 'styled-components';
import Link from 'next/link';

const Styled = styled.section``;

const TopBilledCast = ({ data }) => {
  return (
    <Styled className='top--billed--cast'>
      <h3 className='title'>Top Billed Cast</h3>
      <div className='content'>
        <div className='cast--card'>
          <Link href='/person/[id]' as={`/person/${data.id}`}>
            <img
              src={`${IMG_URL}${movie.profile_path}`}
              alt={movie.title || movie.name}
              className='cast--card__img'
            />
          </Link>
          <Link href='/person/[id]' as={`/person/${data.id}`}>
            <h3 className='name'>{data.name}</h3>
          </Link>
          <div className='character'>{data.character}</div>
        </div>
      </div>
      <Link href='/movie/cast'>Full Cast & Crew</Link>
    </Styled>
  );
};

export default TopBilledCast;
